css:
.list-group li:not(.list-nested-item).status-added,
.list-tree li:not(.list-nested-item).status-added,
.list-group li.list-nested-item.status-added > .list-item,
.list-tree li.list-nested-item.status-added > .list-item,
.list-group li:not(.list-nested-item).status-modified,
.list-tree li:not(.list-nested-item).status-modified,
.list-group li.list-nested-item.status-modified > .list-item,
.list-tree li.list-nested-item.status-modified > .list-item {
  color: #747369;
}
.tree-view .icon::before {
  display: none;
}
atom-text-editor,
atom-text-editor .gutter {
  background-color: #1e1e1e;
}
.deprecation-cop-status,
.deprecation-cop-status:hover {
  color: #747369;
}
linter-bottom-status {
  color: #747369!important;
}
atom-notification.error {
  display: none;
}
.indent-guide {
  opacity: 0.4;
}
atom-text-editor .scroll-view {
  padding-left: 0;
}
atom-text-editor .gutter {
  border: none;
}
.icon:before {
  display: none;
}
.cursor-line {
  background-color: #252525;
}
atom-text-editor .gutter .line-number.cursor-line {
  background-color: #333;
}
.terminal {
  font-size: 10px!important;
  font-family: "Monaco";
  -webkit-font-smoothing: none;
}
.platformio-ide-terminal {
  opacity: 0.9;
}
atom-text-editor::shadow .region {
  position: absolute;
  opacity: 0.20;
  padding: 0 2px;
  margin-left: -2px;
  box-sizing: content-box;
}
atom-text-editor::shadow .highlight.linter-warning .region {
  background: none!important;
  -webkit-mask-image: none;
}
atom-text-editor::shadow .highlight.linter-error .region {
  background: none!important;
  -webkit-mask-image: none;
}
